const MenuItem = (className, menu) => {
  return (
    <li className={`${className}__item`}>
      <button 
        data-btn="menu" 
        data-target={menu.target}
      >
        <span>{menu.data}</span>
      </button>
    </li>
  )
}

export default MenuItem
